import React from 'react'
import HeaderAdmin from './HeaderAdmin'
import Footer from '../components/Footer'

const AdminHome = () => {
  return (
    <>
        <HeaderAdmin/>
        <div className='py-22'>Welcome to Admin Page </div>
        <Footer/>
    </>
  )
}

export default AdminHome
